SemQLMatchRule.condition:
/*** Name exact match ***/ ( Record1.FirstName = Record2.FirstName OR Record1.Nickname = Record2.Nickname ) AND Record1.LastName = Record2.LastName
/*** Address exact match ***/ AND Record1.Address.Street = Record2.Address.Street AND Record1.Address.City = Record2.Address.City AND Record1.Address.State = Record2.Address.State AND Record1.Address.PostalCode = Record2.Address.PostalCode AND Record1.Address.Country = Record2.Address.Country
/*** Phone & Email exact match ***/ AND Record1.StandardizedPhone = Record2.StandardizedPhone AND Record1.CleansedEmail = Record2.CleansedEmail

/*** Phonetic Name match ***/ Record1.NormalizedFirstName = Record2.NormalizedFirstName AND Record1.NormalizedLastName = Record2.NormalizedLastName
/*** Address match ***/ AND Record1.Address.Street = Record2.Address.Street AND Record1.Address.City = Record2.Address.City AND Record1.Address.State = Record2.Address.State AND Record1.Address.PostalCode = Record2.Address.PostalCode AND Record1.Address.Country = Record2.Address.Country
/*** Cleansed contact info ***/ AND Record1.StandardizedPhone = Record2.StandardizedPhone AND Record1.CleansedEmail = Record2.CleansedEmail

/*** Name exact match ***/
( Record1.FirstName = Record2.FirstName
   OR Record1.Nickname = Record2.Nickname
) 
AND Record1.LastName = Record2.LastName

/*** Address exact match ***/
AND Record1.Address.Street = Record2.Address.Street
AND Record1.Address.City = Record2.Address.City
AND Record1.Address.State = Record2.Address.State
AND Record1.Address.PostalCode = Record2.Address.PostalCode
AND Record1.Address.Country =  Record2.Address.Country

/*** Date of birth exact match ***/
AND Record1.DateOfBirth = Record2.DateOfBirth

/*** Phonetic Name match ***/ Record1.PhoneticFirstName = Record2.PhoneticFirstName AND Record1.PhoneticLastName = Record2.PhoneticLastName
/*** Address match ***/ AND Record1.Address.Street = Record2.Address.Street AND Record1.Address.City = Record2.Address.City AND Record1.Address.State = Record2.Address.State AND Record1.Address.PostalCode = Record2.Address.PostalCode AND Record1.Address.Country = Record2.Address.Country
/*** Cleansed contact info ***/ AND Record1.StandardizedPhone = Record2.StandardizedPhone AND Record1.CleansedEmail = Record2.CleansedEmail

/*** Name exact match ***/
( Record1.FirstName = Record2.FirstName
   OR Record1.Nickname = Record2.Nickname
) 
AND Record1.LastName = Record2.LastName

/*** Date of birth exact match ***/
AND Record1.DateOfBirth = Record2.DateOfBirth

/*** Email exact match ***/
AND Record1.CleansedEmail = Record2.CleansedEmail

/*** Matching on similar names, catching typos ***/
( SEM_EDIT_DISTANCE_SIMILARITY( Record1.FirstName, Record2.FirstName ) > 75
AND SEM_EDIT_DISTANCE_SIMILARITY(Record1.LastName, Record2.LastName ) > 75
)
OR
( SEM_EDIT_DISTANCE_SIMILARITY( Record1.NormalizedFirstName,  Record2.NormalizedFirstName ) > 80
AND SEM_EDIT_DISTANCE_SIMILARITY( Record1.NormalizedLastName, Record2.NormalizedLastName ) > 80 
)

/*** Match on similar address ***/
AND  SEM_EDIT_DISTANCE_SIMILARITY( Record1.Address.Street, Record2.Address.Street )  > 75
AND  SEM_EDIT_DISTANCE_SIMILARITY( Record1.Address.City,  Record2.Address.City ) > 75

/*** Exact match on zip code, state, and country ***/
AND Record1.Address.State = Record2.Address.State
AND Record1.Address.PostalCode = Record2.Address.PostalCode
AND Record1.Address.Country = Record2.Address.Country
